import axios from "axios";
export default ()=>{
  let Recipies=[];
  axios.get("http://localhost:8080/api/recipe")
  .then((data) => {
    Recipies = data.data
    console.log(Recipies);
  
}).catch (()=>{
navigate("/SignIn",{state:data});
});
}
